import React from "react";
import { Helmet } from "react-helmet";

const Home = () => {
  return (
    <>
    <Helmet>
    <meta property="og:type" content="article" />
    <meta property="og:title" content="В Москве побит температурный рекорд 1922 года" />
    </Helmet>
      test
    </>
  );
};

export default Home;
